	85 => [
		'service_id' => '85',
		'service_name' => 'erc',
		'parent_id' => null,
		'merchant' => 'killbill',
		'name' => 'Астана-ЕРЦ',
		'title' => 'Оплата пакета коммунальных услуг',
		'description' => 'Агрегатор коммунальных платежей в городе Астана',
		'description_company' => '<p>ТОО «Астана-ЕРЦ» - специализированное предприятие, основной задачей которого является совершенствование системы расчетов и сбора платежей за коммунальные услуги. Доминантным учредителем компании является государство.</p><p>На текущий момент компания обслуживает более 215 тысяч лицевых счетов и сотрудничает с более 383 поставщиками услуг.</p>',
		'choice_service_text' => '',
		'site' => '',
		'picture' => 'service5a4e14e78a06a7.24240821.png',
		'pic_prefix' => 'ЕРЦ',
		'background' => '#126b7b',
		'library_date' => '2016-01-26 16:10:51',
		'instruction' => '<p>2007452</p><p>Чтобы оплатить коммунальные услуги, необходимо ввести номер лицевого счёта в «ЕРЦ», нажать «Проверить задолженность», ввести значения в поля сумм и нажать кнопку «Оплатить».</p><p>При нажатии кнопки «Проверить задолженность» перед вами появится квитанция, которую предоставляет компания «Астана-ЕРЦ». В квитанции отображены показания счетчиков за предпоследний и последний месяц (например, если вы оплачиваете квитанцию в октябре за сентябрь, то вы видите показания августа и сентября), тарифы коммунальных компаний, задолженность или переплата и сумма к оплате.</p><p>Информация о зачислении в базе ЕРЦ обновляется по наступлению нового расчетного периода, таким образом, при проверке задолженности сразу же после оплаты, будут отображены старые данные.</p><p>При заполнении сумм в квитанции не обязательно вводить точную сумму, указанную к оплате - вы можете для удобства округлять суммы в большую сторону.</p><p>Если вы заметили, что суммы к оплате не совпадают с предполагаемыми вами, то обратите внимание на дату квитанции, указанную самой первой строкой в квитанции - компания «Астана-ЕРЦ» может иногда задерживать выгрузку свежих квитанций. Если вы заметили, что квитанция еще не обновлена - попробуйте повторно обновить квитанцию, до тех пор, пока она не будет отображать данные оплачиваемого вами месяца, либо введите суммы, которые считаете необходимым оплатить, даже если они отличаются от указанных в квитанции.</p>',
		'contacts' => '<p>Если у вас возникли вопросы о зачислении платежа, в первую очередь, обратитесь в Службу поддержки пользователей Wooppay по номерам телефонов:</p><ul>
<li>+7 (7212) 981-090 (для Караганды);</li><li>+7 (7273) 441-414 (для Алматы);</li><li>+7 (7172) 795-004 (для Астаны) или в раздел «<a href="https://www.wooppay.com/services?needConsultant=true">Помощь</a>» сайта Wooppay.</li></ul><p>Получить консультации по другим вопросам, а также передать показания приборов учета вы можете, обратившись в Call-центр компании «Астана-ЕРЦ» по номерам телефонов:</p><ul>
<li>+7 (7172) 707-444 (для Астаны);</li><li>+7 (7172) 999-633(для Астаны).</li></ul><p>Официальный сайт: <a href="http://www.aerc.kz/">www.aerc.kz</a></p>',
