		'description_company' => '<h1>Dockerizing Applications: A "Hello world"</h1><p>
	<em>So what\'s this Docker thing all about?</em></p><p>
	Docker allows you to run applications inside containers. Running an application inside a container takes a single command: <code>docker run</code>.</p><h2>Hello world</h2><p>
	Let\'s try it now.</p>
<pre>&lt;code&gt;$ sudo docker run ubuntu:14.04/bin/echo \'Hello world\'Hello world
</pre><p>
	And you just launched your first container!</p><p>
	So what just happened? Let\'s step through what the <code>docker run</code> command did.</p><p>
	First we specified the <code>docker</code> binary and the command we wanted to execute, <code>run</code>. The <code>docker run</code>combination <em>runs</em> containers.</p><p>
	Next we specified an image: <code>ubuntu:14.04</code>. This is the source of the container we ran. Docker calls this an image. In this case we used an Ubuntu 14.04 operating system image.</p><p>
	When you specify an image, Docker looks first for the image on your Docker host. If it can\'t find it then it downloads the image from the public image registry: <a href="https://hub.docker.com/">Docker Hub</a>.</p><p>
	Next we told Docker what command to run inside our new container:</p>
<pre>&lt;code&gt;/bin/echo \'Hello world\'
</pre><p>
	When our container was launched Docker created a new Ubuntu 14.04 environment and then executed the<code>/bin/echo</code> command inside it. We saw the result on the command line:</p>
<pre>&lt;code&gt;Hello world
</pre><p>
	So what happened to our container after that? Well Docker containers only run as long as the command you specify is active. Here, as soon as <code>Hello world</code> was echoed, the container stopped.</p>',
