		'description_company' => '<p>АО «Кселл» - казахстанский оператор, оказывающий услуги мобильной связи и мобильного интернета.</p><p>Миссия компании - создание новых продуктов и услуг, удовлетворяющих существующие и возникающие потребности клиентов новыми, захватывающими способами.</p><p>На протяжении 14 лет работы на рынке компания постоянно расширяет область охвата сигналом сети. На сегодня сотовая связь, предоставляемая компанией, доступна в 5092 городах и поселках Казахстана.</p><p>Ознакомиться со всеми услугами Kcell можно на официальном <a href="https://www.kcell.kz/ru/article/1142/262">сайте</a> компании.</p>',
