		'pic_prefix' => 'T2C',
		'background' => '#cb7437',
		'library_date' => '2018-04-23 10:20:53',
		'instruction' => '<p>Чтобы оплатить услуги Kcell, необходимо ввести номер телефона, счет которого вы хотите пополнить, и указать сумму пополнения. Будьте внимательны при выборе оператора!</p><p><strong>Перед оплатой убедитесь, что номер принадлежит данному оператору!</strong></p><p>Проверить номер на принадлежность оператору вы можете с помощью команды:</p><ul>
<li>*199*<em>номер абонента</em>#</li></ul><p>После чего вам придёт смс-уведомление с информацией к какому оператору относится введённый номер.</p><ul>
