		'library_date' => '2018-04-23 10:20:53',
		'instruction' => '<p>Чтобы оплатить коммунальные услуги, необходимо ввести номер лицевого счёта в «ЕРЦ», нажать «Получить квитанцию», ввести значения в поля сумм и нажать кнопку «Оплатить».</p><p>При нажатии кнопки «Получить квитанцию» перед вами появится квитанция, которую предоставляет компания «Астана-ЕРЦ». В квитанции отображены показания счетчиков за предпоследний и последний месяц (например, если вы оплачиваете квитанцию в октябре за сентябрь, то вы видите показания августа и сентября), тарифы коммунальных компаний, задолженность или переплата и сумма к оплате.</p><p>При заполнении сумм в квитанции не обязательно вводить точную сумму, указанную к оплате - вы можете для удобства округлять суммы в большую сторону.</p><p>Если вы заметили, что суммы к оплате не совпадают с предполагаемыми вами, то обратите внимание на дату квитанции, указанную самой первой строкой в квитанции - компания «Астана-ЕРЦ» может иногда задерживать выгрузку свежих квитанций. Если вы заметили, что квитанция еще не обновлена - попробуйте повторно обновить квитанцию, до тех пор, пока она не будет отображать данные оплачиваемого вами месяца, либо введите суммы, которые считаете необходимым оплатить, даже если они отличаются от указанных в квитанции.</p>',
		'contacts' => '<p>Если у вас возникли вопросы о зачислении платежа, в первую очередь, обратитесь в Службу поддержки пользователей Wooppay по номерам телефонов:</p><ul><li>+7 (7212) 996-222 (для Караганды);</li><li>+7 (7273) 435-222 (для Алматы);</li><li>+7 (7172) 978-733 (для Астаны) или в раздел «<a href="https://beta.wooppay.com/services?needConsultant=true">Помощь</a>» сайта Wooppay.</li></ul><p>Получить консультации по другим вопросам, а также передать показания приборов учета вы можете, обратившись в Call-центр компании «Астана-ЕРЦ» по номерам телефонов:</p><ul><li>+7 (7172) 707-444 (для Астаны);</li><li>+7 (7172) 999-633(для Астаны).</li></ul><p>Официальный сайт: <a href="http://www.aerc.kz/">www.aerc.kz</a></p>',
