		'description_company' => '<p>ТОО «ИВЦ» - компания, осуществляющая услуги печати, доставки и обработки платежных документов по жилищно-коммунальным и другим видам услуг в Алматы.</p><p>Основными поставщиками услуг являются ПКСК, ЖСК, ПК, предприятия по техническому обслуживанию лифтов, ГЦТ «Алматытелеком», ТОО «Digital TV», предприятия по вывозу твердых бытовых отходов, другие организации и предприятия, оказывающие жилищно-коммунальные услуги.</p>',
