		'instruction' => '<p>5696410</p><p><br>Чтобы оплатить коммунальные услуги, необходимо ввести номер договора в «ИВЦ», нажать «Проверить задолженность», ввести значения в поля сумм и нажать кнопку «Оплатить».</p><p>При нажатии кнопки «Проверить задолженность» перед вами появится квитанция, которую предоставляет компания «ИВЦ». Информация о зачислении в базе ИВЦ обновляется в течение семи дней после оплаты, таким образом, при проверке задолженности сразу же после оплаты, будут отображены старые данные.</p><p>В квитанции отображены показания счетчиков за предпоследний и последний месяц (например, если вы оплачиваете квитанцию в октябре за сентябрь, то вы видите показания августа и сентября). Также в квитанции вы можете посмотреть тарифы коммунальных компаний, задолженность или переплату и сумму к оплате.</p><p>При заполнении сумм в квитанции не обязательно вводить точную сумму, указанную к оплате - вы можете для удобства округлять суммы в большую сторону.</p><p>Если вы заметили, что суммы к оплате не совпадают с предполагаемыми вами, то обратите внимание на дату квитанции, указанную самой первой строкой в квитанции - компания «ИВЦ» может иногда задерживать выгрузку свежих квитанций. Если вы заметили, что квитанция еще не обновлена - попробуйте повторно обновить квитанцию, до тех пор, пока она не будет отображать данные оплачиваемого вами месяца, либо введите суммы, которые считаете необходимым оплатить, даже если они отличаются от указанных в квитанции.</p>',
