		'description_company' => '<p>Bloody World это бесплатная игра, объединяющая в себе многие Интернет игры, но, в то же время, остающаяся уникальной по насыщенности геймплея и качеству исполнения. Кровожадный мир - это web-интерфейсная, многопользовательская онлайн игра с элементами РПГ (online role-playing games, RPG) и стратегии. Персонаж развивается методом проведения боёв и получением за победу определённого количества опыта. Система боя довольно проста и интуитивно понятна. Имеются различные расы - люди , гномы , орки и эльфы . В игре существует разнообразная магия. Каждый игрок сам может выбрать, кем ему стать - непобедимым наемником, карателем, уличным торговцем, солидным лавочником или же добрым лекарем. Каждый может повести за собой людей - объединив их под своим флагом. Можно сражаться не только друг с другом, но и со злобными монстрами, обитающими поблизости. Победив их, можно завладеть ресурсами, с помощью которых кузнец сможет выковать вам оружие или доспехи. Собрав надежную команду, можно углубиться в темные лабиринты и катакомбы и бросить вызов минотаврам и драконам, охраняющим сокровища.</p><p>Много разновидностей альтернативного заработка: рыбалка, собирательство, партнерство, крафт и дроп с монстров. Увлекательные осады замков. Графическое оформление на высшем уровне (не текстовая игрушка). Наша компьютерная игра постоянно развивается и дополняется.</p><p>Устали воевать? - отдохните, пообщайтесь с окружающими, заведите новые знакомства. Но не забывайте - Вы можете нажить себе здесь как друзей, так и врагов. Кто знает, а вдруг вы найдете тут свою вторую половинку не только в виртуале, но и в реальной жизни. Для удобства общения - имеется быстрый и надежный чат с удобным интерфейсом.</p><p>При наличии большого количества графики, данная ролевая мини игра потребляет минимум трафика (3-4 мб/час) и не требует установки на компьютер никаких дополнительных модулей. Для того, чтобы погрузиться в фэнтезийный мир, Вам достаточно иметь только подключение к Инт