		'name' => 'Illodemiur (Светящийся мир)',
		'title' => 'Покупка руанов в игре',
		'description' => 'Кроссплатформенная ролевая онлайн игра в стиле фэнтези',
		'description_company' => '<p>За долгие годы не только писатели, но и разработчики игр создали такое немыслимое количество фэнтезийных миров, что впору утонуть во всем этом изобилии. Однако, с другой стороны, это самое изобилие зачастую не отличается особым разнообразием. Все те же эльфы, гномы, друиды и маги, охотящиеся за золотом и уничтожающие врагов. Но, к счастью, альтернативные варианты тоже встречаются.</p><p>Вселенная Illodemiur заслуживает, чтобы на нее обратили отдельное внимание не только за отсутствие в ней шаблонных длинноухих эльфиек и большеглазых мордашек. Главное конкурентное преимущество Иллодемиура, пожалуй, это возможность подключиться к игровому процессу практически в любое время и в любом месте. Игра поддерживается большинством типов мобильных телефонов и при этом имеет полноценные браузерную и PC-версии. Т.е. вы вполне можете, убегая из дома после бессонной ночи за компьютером в университет на лекции, закончить расправу над врагами уже где-нибудь в автобусе, с мобильного телефона. <br>И все же, давайте по порядку, что же скрывается за непонятным словом Illodemiur, и с чем этот загадочный фрукт едят.</p><p><strong>Быстрее, выше, сильнее..., а еще умнее, выносливей и пронырливей.</strong></p><p>Начнем с того, что где-то явно произошла осечка, и все герои, обычно в последний момент спасающие мир от неминуемой гибели, сильно облажались. Мир, в котором вам предлагается жить, уже испытал свой собственный Армагеддон, называемый здешними обитателями Криком Света. Но даже в условиях фэнтезийного постапокалипсиса, поверьте, здесь есть чем заняться. <br>На огромном (действительно огромном) континенте есть два крупных государства, властители которых откровенно недолюбливают друг друга, и того и гляди начнется война. Уже в самом начале вам предстоит выбрать, гражданином какого государства стать. От вашего выбора будет зависеть, будете ли вы первое время любоваться преимущественно зелеными пейзажами или бродить по бескрайним песчаным просторам, как будет продвигаться ваш профессиональный рост, во что вы будете одеваться и еще тысяча мелочей. <br>Затем следуют стандартные пол, портрет, класс и распределение очков статов между ловкостью, интеллектом, силой и выносливостью. Стоит также обратить внимание на некоторые нюансы при выборе профессии - несмотря на то, что предлагается 4 класса: воитель, чародей, оружейник и следопыт, в зависимости от подданства они будут несколько различаться. Так, к примеру, следопыт Великого княжества Данхольм будет, скорее всего, вором и мастером кинжалов, а следопыт Теберийского королевства - лучником. </p><p>При создании у вашего героя будет только 3 классовых умения. Все остальные придется искать и учить самостоятельно, обивая пороги трактиров, академий и даже тюрем.</p>',
