		'title' => 'Покупка лаббитов в игре',
		'description' => 'Бесплатная online MMORPG с пошаговой боевой системой, вобравшая в себя все актуальные тенденции разработки онлайн-игр',
		'description_company' => '<p><a href="http://www.lostmagic.ru/" style="font-size: 15px;">Lost Magic</a> - это бесплатная online mmorpg с пошаговой боевой системой, вобравшая в себя все актуальные тенденции разработки онлайн-игр.</p><p>В основе сюжета mmorpg игры - борьба за остатки магической энергии между людьми, пришедшими в загадочный Мир с Земли, и его коренными обитателями, которые также враждуют между собой. Полчища нечисти, призраков и мутантов не дадут герою мморпг скучать без дела!</p><p>С первых же уровней «LostMagic» пользователю доступны все обязательные составляющие современной онлайн mmorpg: одиночное прохождение, групповые инстансы, PvP, таблица талантов. Реализована разветвлённая система учёта персональных достижений. Линейное развитие сюжета сопровождается повторяющимися заданиями для усиленной прокачки персонажа. Игроки могут объединяться в гильдии, торговать, соревноваться на Арене.</p><p>С технической стороны мир этой игры mmorpg не ресурсоёмок. Доступна скачиваемая версия клиента. Регулярные обновления ненавязчиво модернизируют Мир, делая локации этой онлайн mmorpg игры больше и лучше.</p>',
