		'description' => 'Браузерная онлайн игра с боями в реальном времени и открытым миром',
		'description_company' => '<p>Аватары: Эпоха Хаоса - многопользовательская ролевая онлайн игра откроет перед вами удивительный мир классического фэнтези, населенный множеством различных созданий, полный загадок и тайн, ждущих своих героев. На просторах Закрытого мира, ставшего последним оплотом гибнущей вселенной и новым домом бывших богов, а ныне Аватаров, Вы встретите все элементы ролевых игр - развитие персонажа, квесты, групповые и одиночные сражения, далекие путешествия, поиск сокровищ и зарабатывание денег, захват замков. А также много нового - мини-игры, логические головоломки, необычные турниры.</p><p>Глубокие шахты, темные подземелья и запутанные лабиринты - всё это ждет Вас. Развитая ролевая система браузерной онлайн игры Аватары, взявшая лучшие черты AD&D, позволит создать Вам своего уникального героя. В этом мире, пожалуй, не найдется и двух совершенно одинаковых персонажей. 7 уникальных рас, 7 профессий, 4 абсолютно непохожих друг на друга школы магии, контактное и стрелковое оружие, десятки навыков, огромный выбор вооружения. Достигнув определенного уровня и выполнив серию непростых заданий, Ваш герой сможет получить высшую форму - переродиться в виде одной из 10 уникальных могущественных рас.</p>',
