		'description_company' => '<p>Браузерная игра <a href="http://www.ereality.ru/" style="font-size: 15px;">Грани Реальности</a> уникальная онлайн игра с огромным потенциалом. Подобного игрового мира невозможно найти в Рунете, и если Вы оказались на этой странице – Вам повезло.</p><p>В нашей игре каждую неделю что-то новое, мы не стоим на месте, - мир Граней постоянно развивается и, если Вы динамичный человек и любите, чтобы Вас удивляли, то Вам будет интересно именно в этой онлайн игре. Сегодня браузерная игра Грани Реальности – арена бескомпромиссных клановых боев и групповых сражений, захватывающих квестов. Здесь вы найдете развитую систему магии, множество мирных профессий, а главное, настоящих друзей.</p><p>Грани Реальности – ролевая игра (RPG). Но, в отличие от набивших оскомину проектов, где нужно выбирать одну из рас (эльфы, некроманты, тролли и т.д.), в нашей онлайн игре ролевые возможности персонажа гораздо шире. Он может быть как могучим, но, увы, неповоротливым воином, так и ловким бойцом, но со слабым уроном. Можно выбрать точного неторопливого витязя со щитом или яростного берсеркера с топором, коварную валькирию или ужасающего носферату… возможности неисчерпаемы. В игре существуют 4 стихии магии (вода, земля, воздух, огонь). У вас будет поистине безграничный выбор.</p><p>Вам не придется ничего скачивать и устанавливать на компьютер дополнительно. Вы играете непосредственно в браузере. Все, что вам нужно, - это компьютер с доступом в Интернет.</p><p>Умело маневрировать в поединке и выбирать оптимальную тактику боя – вот залог успеха, а не финансовые вложения. Свой стиль игры и манеру ведения боя вы будете определять самостоятельно. Развивать своего персонажа, участвовать в сражениях и поединках, заниматься мирным трудом и проходить квесты вы будете только в режиме реального времени. Вам не нужно будет сохранять игру на определенном этапе, так как процесс игры возобновляется сразу, как только вы снова войдете в свой аккаунт.</p><p>Мы собрали все лучшее, что могли бы предложить вам современные браузерные игры. Этот фэнтези мир ждет вас. Мы думаем, что интереснее отдыха Вам не найти. Добро пожаловать!</p>',
