		'description_company' => '<p>Передовая – историческая браузерная онлайн игра по мотивам Второй Мировой Войны. События игры охватывают временные рамки 1939-1943 года, но не являются исторически достоверными фактами. Игра основана на противостоянии Вермахта и РККА, которое происходит на территории различных городов. Основой геймплея является система боев между игроками, как между двумя (дуэли), так и между несколькими (сражения). Особенностью игры является то, что многие игровые предметы (одежда, автомобили, оружие) имеют исторические аналоги. Таким образом, проект несет некоторый просветительский элемент, так как игрок непосредственно соприкасается с историей.</p><p>В игре пользователь имеет возможность сражаться онлайн с другими игроками, приобретать различные Навыки и Специализации, а также продвигаться по лестницам уровней игры и армейских званий. Игра является совершенно бесплатной и не требует вложения денежных средств. Но, как и в реальном мире, здесь присутствуют виртуальные товарно-денежные отношения. Персонаж имеет различные возможности для заработка: работа на заводе, обучение новобранцев, игровой рост, продажа дропа, полученно в боях с ботами, а также привлечение новых игроков и т.д.</p><p>При регистрации персонажа игроку предлагается вступить в армию любой из сторон - РККА (СССР) или Вермахт (Германия) и внести посильный вклад в ход создаваемой игрой истории. У каждой стороны имеется свой центральный город Нюрнберг для Вермахта и город Горький для РККА. Несмотря на то, что названия этих городов, как для советской так и немецкой стороны, являются реальными, их образ, представленный в игре, является собирательным. Всего в игре представлено более 100 локаций.</p><p>В настоящий момент воюющие фракции сталкиваются в массовых сражениях за контролем над территориями (бои происходят ежедневно).</p>',
