		'description_company' => '<p>Satu.kz – лидирующий онлайн-маркетплейс Казахстана, где тысячи компаний ежедневно продают разнообразные товары и услуги сотням тысяч пользователей.</p><p>Satu.kz прочно удерживается в десятке самых посещаемых сайтов страны (по данным Zero.kz). Продавцы, не имеющие опыта в e-commerce, благодаря Satu.kz быстро и легко получают доступ к нужной аудитории и к профессиональному набору инструментов для организации продаж и продвижения своих товаров в интернете.<br>Satu.kz – казахский интернет-проект, который был основан в 2008 году Николаем Палиенко, Денисом Горовым и Тарасом Мурашко. Он был запущен параллельно с аналогичными торговыми площадками в Украине (Prom.ua) и Беларуси (Deal.by). Уже в 2009 году проект привлек внушительные инвестиции южноафриканского холдинга Naspers.<br>В мае 2016 года в результате реорганизации Satu.kz вошел в группу компаний EVO, к которой также относятся онлайн-сервис заказа услуг Megamaster.kz и его аналоги на украинском, беларусском и российском рынках, торговая площадка государственных и коммерческих закупок Zakupki.Prom.ua (Украина), онлайн-маркетплейсы Bigl.ua, Crafta.ua.</p><p>Сегодня на платформе Satu.kz создали свои сайты более 22 700 компаний, которые разместили 7 100 000 товаров и услуг в каталоге портала.</p>',
